import React from 'react'
import Output from './output'

const Input = () => {
    return (
        <div>
            <h1>Bismillah Bisa</h1>
            <Output name='Husnul' age='21'/>
            <Output name='Khuluk' age='21'/>
        </div>
    )
}

export default Input
